    false,nt"url": null,nt"notes": "Palmyra Island Monthly Coral Oxygen Isotope
    Data. 112-yr, monthly-resolved coral record from Palmyra Island (5 deg 52 min N,
    162 deg 8 min W). The coral was drilled in ~30' of water from the reef flat extending
    off the west side of the island. The data are in two columns: date (in year) and
    oxygen isotopic value (per mill). The data are monthly samples of the raw dataset
    and have not been deseasoned or detrended. We calculate the analytical precision
    at less than 0.05 per mill, based on over 500 measurements of an internal aragonitic
    laboratory standard measured while running the Palmyra coral.",nt"license_title":
